(631, 40, 'about_content', '<p>Tatrooms is an Indian hotel chain. It initially focuses on budget hotels around the country. The startup is expanding nationally with hundreds of hotels, vacation homes and millions of rooms in hundreds of cities in different states including Kolkata, Bhubaneshwar, guwahati, Puri, Jamsedhpur, Patna,Ranchi, Cuttack.</p>\r\n<p>Our view is to create a sense of belongings and community in the heart of tourism industry in india. We will try to achieve this through fair pricing and safety to tourists coming to stay with us.</p>'),
