(3431, 155, 'hotel_information', 'Geetanjali Regency is a classy and cosy property situated in an easily accessible area in VIP Road, Kolkata.\r\nGeetanjali Regency is located in an ideal location that the guests can wander around places in Kolkata like Victoria Memorial, James Prinsep Ghat, Boating Point in Eco Park, Eco Park, Rain Garden, Terracotta Replica, Maa Durga Statue, Culture And Heritage Of Kolkata and Science City. The visitors can visit famous restaurants in the area like KFC, Thali Hut, Hatari, Gangaur Veg Restaurant, Shinryu Restaurant & Bar, Momo I Am, Spicy Kitchen, Golden Park, Hotel King\'s Crow Banquet & Lawn and Kabuliwala.\r\n'),
