(3453, 157, 'hotel_information', 'The Memari Rajbari is located about 100km by road from Kolkata via National Highway 19 , it is home to the  glimmers of a rich past whose existence might have disappeared had it not been for an ambitious tie-up between Shiladitya Chaudhuri.\r\nThe Amadpur High School ( School Bari as it is popularly known) which was founded & established by a well known scion of the Chaudhuri family, Shri Mohes Chandra Chaudhuri, dates back to the middle / late 19th century boasts of the distinction of having been inaugurated by scholar, social reformer, Pandit Ishwar Chandra Vidyasagar who was a close friend of the founder.\r\n'),
