(3490, 162, 'hotel_information', 'Hotel Naren Palace in Puri provides great hospitality and comfortable accommodation options to all its guests.Rooms - The hotel has to its credit, a total of 37 beautifully designed rooms in 3 categories, i.e. Super Deluxe, Deluxe and Standard AC. All rooms come complete with in-room amenities like cable television, air-conditioning, mini bar, refrigerator, direct dial telephone with STD/ISD and attached washroom with hot and cold running water and bathroom toiletries. Dining & Facilities Besides a multi-cuisine restaurant serving delicious food, the hotel also provides a host of other facilities to its guests such as free parking, doctor on call, 24 Hrs.'),
