(3526, 165, 'hotel_information', 'Hotel Kalinga is nestled in Puri, this holy seaside destination where devotees throng especially to visit the Jagannath Temple, Hotel Kalinga greets its guests to a wonderful ambience of warmth and care. The property is easily accessible from city railway station, bus stand and Shree Jagannath Temple and Puri Beach.\r\n\r\nThe hotel offers facilities like front desk, parking, housekeeping and doctor on call in case of medical emergencies. The rooms at the hotel are textural and spatial delight. They have a contemporary ambience offering visitors comfort, harmony and warm atmosphere. The guest rooms have attached bathrooms equipped with hot and cold water facility. Guests can head to nearby restaurants to have regional and multicuisine food.'),
