(3544, 167, 'hotel_information', 'Biswanath Heritage is a popular choice amongst travelers in Puri, whether exploring or just passing through. The property offers a high standard of service and amenities to suit the individual needs of all travelers. Free Wi-Fi in all rooms, 24-hour room service, daily housekeeping, 24-hour front desk, room service are just some of the facilities on offer. Each guestroom is elegantly furnished and equipped with handy amenities. The property offers various recreational opportunities.\r\nBiswanath Heritage is an excellent choice from which to explore Puri or to simply relax and rejuvenate.'),
