(3693, 173, 'hotel_information', 'Traveling anytime soon? Looking for a value for money accommodation? This charming property has everything required to make your stay memorable. It is exclusively designed with travelers requirements in mind. It encloses a comfortably furnished bedroom, with a snuggly bed covered with spotless linen.\r\nTo make your stay hassle-free, It has implemented a complete set of modern day amenities. The living space is furnished with top-notch furniture and enhanced with trendy decor. Not to forget, cleanliness is always right up there on our priority list.\r\n\r\nGetting around through public transport is quite convenient. The city has something for every traveler. You just have to go outside and explore!\r\n\r\nIf you are traveler looking for a comfortable stay, this is a great choice to make. We look forward to ensuring round the clock assistance to make your experience a delightful one. Come soon!'),
