(6754, 374, '_field_message', '\r\nHi,\r\n\r\nLet’s take a quick trip to Tomorrow-land.\r\n\r\nI’m not talking about a theme park, I’m talking about your business’s future…\r\n\r\nDon’t worry, we won’t even need a crystal ball.  \r\n\r\nJust imagine… \r\n\r\n… a future where the money you invest in driving traffic to your site tatrooms.com pays off with tons of calls from qualified leads.\r\n \r\nAnd the difference between what you experienced in the past is staggering – you’re seeing 10X, 20X, 50X, even up to a 100X more leads coming from your website tatrooms.com.  Leads that are already engaged with what you have to offer and are ready to learn more and even open their wallets.\r\n\r\nSeeing all this taking place in your business, you think back: What did I do only a short time ago that made such a huge difference?\r\n\r\nAnd then it hits you: You took advantage of a free 14 day Test Drive of TalkWithCustomer.\r\n\r\nYou installed TalkWithCustomer on tatrooms.com – it was a snap.\r\n\r\nAnd practically overnight customers started engaging more regularly and calling your business. Like this: EMA has been looking for ways to reach out to an audience. TalkWithCustomer so far is the most direct call of action. It has produced above average closing ratios and we are thrilled. Thank you for providing a real and effective tool to generate REAL leads.  - Patrick Montes\r\n\r\nSince you installed TalkWithCustomer it’s been great.\r\n\r\nIt’s fun to dream, but this isn’t just a dream. It could be your very real tomorrow.\r\n \r\nAll you have to do is CLICK HERE http://www.talkwithcustomer.com to sign up to try TalkWithCustomer today.\r\n\r\nNot tomorrow. Today.\r\n\r\nBecause there’s no better time than now to make your business work the way you’ve always wanted.\r\n \r\nSincerely,\r\nEric\r\nPS: Remember, there’s absolutely NO risk to you – if you’re 100% satisfied after the 14 days pass, there’s no obligation.  And even ONE more lead-turned-into-customer could be worth hundreds, even thousands to you over their lifetime. \r\n\r\nDon’t let the moment pass you by.  CLICK HERE http://www.talkwithcustomer.com to sign up for this free test drive now.  \r\n\r\nIf you\'d like to unsubscribe click here http://liveserveronline.com/talkwithcustomer.aspx?d=tatrooms.com\r\n'),
