(7769, 494, '_field_subject', 'B2B EMERGENCY SUPPLIERS REQUIRED'),
(7770, 494, '_field_message', 'Dear Colleagues \r\n \r\nWe are located in the United Kingdom, and trading under the famous supermarket chain name Sainsbury\'s Supermarkets Limited. It is UK\'s one of the largest multi-channel retailer with over 1423 shops furnished by European products. As you already aware UK in on lockdown due to coronavirus and we urgently looking for new suppliers with any kind of products currently you keeping in stock. We are looking for all kind of products to attract new customers and also retained our existing ones, as long as you have them in stock for immediate shipping. \r\n \r\nPlease send us your catalogue or your website through email to speed up the process and treat this email as urgent. We hope to be able to order with you and start a long-term friendly, respectable and solid business partnership. \r\n \r\nWe count on the reliability of both sides. We commit ourselves for successful and professional processing for good cooperation in all ranges. \r\n \r\nPlease, keep in mind that we are only interested in the products you currently have in stock. \r\n \r\nWe would appreciate if you could send us your stock availability via email: suppliers@sainsburysplcs.com \r\n \r\nWe will also be pleased to receive any offers or proposals from other products available and ready (Stocks and rates). \r\n \r\nTarget: Our Payment Term is swift within 30 days net in Europe and 15 days NET in UK  as we operate with all our suppliers. \r\n \r\nSainsbury\'s Supermarkets Limited \r\nPurchasing Department \r\n \r\n33 Holborn \r\nLondon \r\nUnited Kingdom \r\nEC1N 2HT \r\n \r\nEmail: suppliers@sainsburysplcs.com \r\n \r\nHelpline: +442039981997 (+44 203 998 1997 or 02039981997)'),
(7771, 494, '_field_submit', 'Send Message'),
