(10933, 809, '_field_subject', 'Arthur sagt danke, es fehlt nur noch wenig'),
(10934, 809, '_field_message', 'Am 5. Januar wurde ein wunderbares Kind geboren. Dieses Kind benötigt aufgrund der Fusion der Schädelnaht (Craniosynostose) eine schwere Kopfoperation. Als Vater dieses wunderbaren Kindes ist es für mich nicht bezahlbar die Teure Medizinische Versorgung zu übernehmen. Es bleibt dem Kind nur noch 6 Wochen Zeit sich auf eine Operation vorzubereiten. Bitte helfen Sie meinem Kind durch eine Spende. Die Sammlung wird durch eine Wohltätigkeitsorganisation organisiert. \r\n \r\nhttps://www.operationfuerarthur.de/ \r\n \r\nBitte klicken Sie oben rechts für Deutsch. Danke für Ihre Unterstützung. Aneta. Mehr Informationen charity@choose2help.org'),
