(426, 0, '2020-02-06 12:20:47', '2020-02-06 12:20:47', 'JoshuaAvara\nsuppliers@allmaconstruction.co.uk\nCommercial collaboration\nDear, \r\nWe made contact with you earlier today regarding our interest to work with your company. \r\nAllma Construction is a multinational infrastructure group based in the United Kingdom with capabilities in construction services, support services and infrastructure investments. \r\nWe are currently looking to expend our main business into new improvement department, such us household appliances, electrical sector, HVAC equipment; thus, to create new partnerships. \r\nCould you please send us your catalogue through e-mail to learn more about your products \r\nand your wholesale pricing structure. \r\nAlso note that we are opened to any new products presentation for a competitive market. \r\nPlease let us know the type of product you may have available which could fulfil our actual needs above and how we can enter into cooperation with your company. \r\nPlease feel to reply if we comply with your company’s vision also if you require more information. \r\nFor our ongoing UK construction works we are currently looking: \r\nELECTRICAL AND CONSTRUCTION CABLES: TWIN AND EARTH, H07RN-F, H07RB-8-F ETC \r\nTINPLATE - COOPER ROOF TILES – COOPER NAIL – COOPER SHEET \r\nPOWERED INDUSTRIAL TRUCK: FORKLIFT - DRILLING MACHINE - POWER TOOL - OUTBOARD ENGINE - OUTBOARD MOTOR - AIR CONDITIONER – and BOILER. \r\nAlso, these products below \r\nMARBLE – and GRANITE and TILE AND FLOORING MATERIAL – SOLAR PANEL \r\n \r\nSANITARY APPLIANCES: BATH AND FAUCETS - BATI SUPPORT - WALL HUNG TOILETS - TAPS - BIDETS - WASH BASINS etc, LIGHTING: LIGHT BULBS / OUTDOOR LIGHTING \r\nPlease feel free to contact us via Email: info@allmaconstruction.co.uk \r\n \r\nBest regards, \r\n \r\nAllma Construction Limited \r\n28 Muriel Street, \r\nBarrhead, \r\nGlasgow, \r\nG78 1QB \r\nUnited Kingdom \r\n \r\nCustom Support &amp; Sales: \r\n+44 141 375 7212 \r\n \r\nCompany reg: SC132432 VAT: GB 554 72 2340\nSend Message\n17\n84.17.61.4\nMozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.170 Safari/537.36 OPR/53.0.2907.99\nhttps://tatrooms.com/contact-us/\nFebruary 6, 2020\n12:20 pm\nTAT ROOMS\nJust another WordPress site\nhttps://tatrooms.com\ndebamalyas.software.tutorials@gmail.com', 'Commercial collaboration', '', 'publish', 'closed', 'closed', '', 'commercial-collaboration', '', '', '2020-02-06 12:20:47', '2020-02-06 12:20:47', '', 0, 'https://tatrooms.com/?post_type=flamingo_inbound&p=426', 0, 'flamingo_inbound', '', 0),
