(457, 0, '2020-03-11 16:25:38', '2020-03-11 16:25:38', 'Sanchez Castillo\nfax.promotion@consultant.com\nIch benotige dringend Ihre Antwort\nGuten Tag, \r\nMein Name ist Anwaeltin Sanchez Castillo. Ich habe Ihnen zuvor eine Nachricht bezüglich einer Transaktion in Höhe von 8,5 Millionen US-Dollar gesendet, die mein verstorbener Kunde vor seinem plötzlichen Tod hinterlassen hat. \r\nIch melde mich noch einmal bei Ihnen, da ich nach Durchsicht Ihres Profils fest davon überzeugt bin, dass Sie die Transaktion sehr gut mit mir abwickeln können. \r\nWenn Sie interessiert sind, möchte ich darauf hinweisen, dass nach der Transaktion 20% dieses Geldes unter Wohltätigkeitsorganisationen aufgeteilt werden sollen, während die restlichen 80% zwischen uns aufgeteilt werden, also jeweils 40%. \r\nDiese Transaktion ist zu 100% risikofrei. Bitte antworten Sie mir so schnell wie möglich, um weitere Erläuterungen zur Transaktion zu erhalten. Meine E-Mail infocastilloabogados@mail.com Tel: +34-932 204 296 \r\nMit freundlichen Gruessen, \r\nSanchez Castillo \r\nAnwaeltin.\nSend Message\n28\n190.2.149.26\nMozilla/5.0 (Windows NT 6.1; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.170 Safari/537.36 OPR/53.0.2907.106\nhttps://tatrooms.com/contact-us/\nMarch 11, 2020\n4:25 pm\nTAT ROOMS\nJust another WordPress site\nhttps://tatrooms.com\ndebamalyas.software.tutorials@gmail.com', 'Ich benotige dringend Ihre Antwort', '', 'publish', 'closed', 'closed', '', 'ich-benotige-dringend-ihre-antwort', '', '', '2020-03-11 16:25:38', '2020-03-11 16:25:38', '', 0, 'https://tatrooms.com/?post_type=flamingo_inbound&p=457', 0, 'flamingo_inbound', '', 0),
(458, 0, '2020-03-11 19:39:51', '2020-03-11 19:39:51', 'DerrickDen\nsuppliers@bellwaysplc.co.uk\nCommercial Collaboration\nDear, \r\n \r\nWe made contact with you earlier today regarding our interest to work with your company. \r\n \r\nBellway PLC is a multinational infrastructure group based in the United Kingdom with capabilities in construction services, support services and infrastructure investments. \r\n \r\nWe are currently looking to expand our main business into new improvement department, such as household appliances, electrical sector, HVAC equipment; thus, to create new partnerships. \r\n \r\nCould you please send us your catalogue through e-mail to learn more about your products \r\n \r\nand your wholesale pricing structure. \r\n \r\nAlso, note that we are opened to any new INTERIOR and EXTERIOR construction products presentation for a competitive market so if you have anything to offer please do not hesitate and offer it to us. \r\n \r\nPlease let us know the type of product you may have available which could fulfils our actual needs above and how we can enter into cooperation with your company. \r\n \r\nPlease feel to reply if we comply with your company’s vision also if you require more information. \r\n \r\nFor our ongoing UK construction works we are currently looking: \r\n \r\nELECTRICAL AND CONSTRUCTION CABLES: TWIN AND EARTH, H07RN-F, H07RB-8-F ETC \r\n \r\nTINPLATE - COOPER ROOF TILES – COOPER NAIL – COOPER SHEET \r\n \r\nPOWERED INDUSTRIAL TRUCK: FORKLIFT - DRILLING MACHINE - POWER TOOL - OUTBOARD ENGINE - OUTBOARD MOTOR - AIR CONDITIONER – and BOILER. \r\n \r\nCONSTRUCTION INTERIOR AND EXTERIOR BUILDING MATERIALS AND TOOLS. \r\n \r\nAlso, these products below \r\n \r\nMARBLE – and GRANITE and TILE AND FLOORING MATERIAL – SOLAR PANEL \r\n \r\nSANITARY APPLIANCES: BATH AND FAUCETS - BATI SUPPORT - WALL HUNG TOILETS - TAPS - BIDETS - WASHBASINS etc, LIGHTING: LIGHT BULBS / OUTDOOR LIGHTING \r\n \r\nPlease feel free to contact us via \r\n \r\nEmail: info@bellwaysplc.co.uk \r\n \r\nBest regards \r\n \r\nBELLWAY PLC \r\n \r\nSEATON HOUSE \r\nDUDLEY LANE \r\nNEWCASTLE UPON TYNE \r\nNE13 6BE \r\nUNITED KINGDOM \r\n \r\nCustom Support &amp; Sales: \r\n \r\n+44 199 422 0163 \r\n \r\nCompany reg: 01372603 VAT: GB 176 68 5416\nSend Message\n29\n37.120.217.107\nMozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3396.87 Safari/537.36 OPR/54.0.2952.64 (Edition Yx)\nhttps://tatrooms.com/contact-us/\nMarch 11, 2020\n7:39 pm\nTAT ROOMS\nJust another WordPress site\nhttps://tatrooms.com\ndebamalyas.software.tutorials@gmail.com', 'Commercial Collaboration', '', 'publish', 'closed', 'closed', '', 'commercial-collaboration-2', '', '', '2020-03-11 19:39:51', '2020-03-11 19:39:51', '', 0, 'https://tatrooms.com/?post_type=flamingo_inbound&p=458', 0, 'flamingo_inbound', '', 0),
