(535, 0, '2020-04-03 10:22:47', '2020-04-03 10:22:47', 'Jerrysmuth\nno-replytypetteNic@gmail.com\nA new method of email distribution.\nGood day!  tatrooms.com \r\n \r\nDid you know that it is possible to send letter wholly legal? \r\nWe sell a new legitimate method of sending business proposal through feedback forms. Such forms are located on many sites. \r\nWhen such letters are sent, no personal data is used, and messages are sent to forms specifically designed to receive messages and appeals. \r\nAlso, messages sent through contact Forms do not get into spam because such messages are considered important. \r\nWe offer you to test our service for free. We will send up to 50,000 messages for you. \r\nThe cost of sending one million messages is 49 USD. \r\n \r\nThis offer is created automatically. Please use the contact details below to contact us. \r\n \r\nContact us. \r\nTelegram - @FeedbackFormEU \r\nSkype  FeedbackForm2019\nSend Message\n35\n109.248.149.22\nMozilla/5.0 (Windows NT 6.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3396.99 Safari/537.36\nhttps://tatrooms.com/contact-us/\nApril 3, 2020\n10:22 am\nTAT ROOMS\nJust another WordPress site\nhttps://tatrooms.com\ndebamalyas.software.tutorials@gmail.com', 'A new method of email distribution.', '', 'publish', 'closed', 'closed', '', 'a-new-method-of-email-distribution', '', '', '2020-04-03 10:22:47', '2020-04-03 10:22:47', '', 0, 'https://tatrooms.com/?post_type=flamingo_inbound&p=535', 0, 'flamingo_inbound', '', 0),
