(616, 0, '2020-04-23 20:34:39', '2020-04-23 20:34:39', 'RaymondBiopy\ninfo@sainsburyplc.com\nB2B EMERGENCY SUPPLIERS REQUIRED\nDear Colleagues \r\n \r\nWe are located in the United Kingdom, and trading under the famous supermarket chain name Sainsbury\'s Supermarkets Limited. It is UK\'s one of the largest multi-channel retailer with over 1423 shops furnished by European products. As you already aware the UK in on lockdown due to coronavirus and we urgently looking for new suppliers with any kind of products currently you keeping in stock. We are looking for all kind of products to attract new customers and also retained our existing ones, as long as you have them in stock for immediate shipping. \r\n \r\n \r\nPlease send us your catalogue or your website through email to speed up the process and treat this email as urgent. We hope to be able to order with you and start a long-term friendly, respectable and solid business partnership. \r\n \r\n \r\nWe count on the reliability of both sides. We commit ourselves for successful and professional processing for good cooperation in all ranges. \r\n \r\n \r\nPlease, keep in mind that we are only interested in the products you currently have in stock. \r\n \r\n \r\nWe would appreciate if you could send us your stock availability via email: suppliers@sainsburyplc.com \r\n \r\n \r\nWe will also be pleased to receive any offers or proposals from other products available and ready (Stocks and rates). \r\n \r\n \r\nTarget: Our Payment Term is swift within 30 days net in Europe and 15 days NET in UK  as we operate with all our suppliers. \r\n \r\n \r\n \r\nSainsbury\'s Supermarkets Limited \r\nPurchasing Department \r\n \r\n33 Holborn \r\nLondon \r\nUnited Kingdom \r\nEC1N 2HT \r\n \r\nEmail: suppliers@sainsburyplc.com \r\n \r\nHelpline: +442081266699  (+44 208 126 6699 or 020 8126 6699)\nSend Message\n45\n84.17.49.183\nMozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.170 Safari/537.36 OPR/53.0.2907.99\nhttps://tatrooms.com/contact-us/\nApril 23, 2020\n8:34 pm\nTAT ROOMS\nJust another WordPress site\nhttps://tatrooms.com\ndebamalyas.software.tutorials@gmail.com', 'B2B EMERGENCY SUPPLIERS REQUIRED', '', 'publish', 'closed', 'closed', '', 'b2b-emergency-suppliers-required-2', '', '', '2020-04-23 20:34:39', '2020-04-23 20:34:39', '', 0, 'https://tatrooms.com/?post_type=flamingo_inbound&p=616', 0, 'flamingo_inbound', '', 0),
